list_metodo = [('1','9'), ('2','8'), ('3','7'), ('4','6'), ('5','0'), ('6','4'), ('7','3'), ('8','2'), ('9','1'), ('0','5')]

def pertenece(x):
  flag = False
  pos = None
  for j in range(len(list_metodo)):
    if x == list_metodo[j][0]:
      flag = True
      pos = j
  return flag, pos


def codificacion(mensaje):
  '''Función encargada de codificar mensajes'''
  mens_codif = ''
  for i in mensaje:
    x, y = pertenece(i)
    if x:
      mens_codif += list_metodo[y][1]
    else:
      mens_codif += i

  return mens_codif


def decodificacion(mensaje_codi):
  '''Función encargada de decodificar mensajes'''
