# Pilas

class Pila:
  def __init__(self):
    self.lista = []

  def push(self, data):
    self.lista.append(data)

  def pop(self):
    data = self.lista.pop()
    return data

  def isEmpty(self):
    return len(self.lista) == 0


def informe(registros):

  cont_chevr, cont_mod, cont_kilo, cont_precio = 0, 0, 0, 0
  list_puertas = []

  pila_auto = Pila()

  for i in registros:
    pila_auto.push(i)

  while not pila_auto.isEmpty():
    auto = pila_auto.pop()
    if auto[0] == 'Chevrolet': cont_chevr += 1
    if int(auto[2]) <= 2010: cont_mod += 1
    if 50000 <= int(auto[9]) <= 100000: cont_kilo += 1
    if int(auto[11]) <= 15000000: cont_precio += 1
    if int(auto[10]) == 4: list_puertas.append(auto)

  return cont_chevr, cont_mod, list_puertas, cont_kilo, cont_precio

