"""# **Reto 5**

## Estadística TESLA

Tabajando sobre el archivo TSLA.csv, se solicita la siguienta información:

1. Crear un nuevo archivo llamado 'tendencia.csv' donde se informe por fecha si el precio de las acciones subieron o bajaron

| Fecha | Comportamiento|
|:-|:-:|
|2020-06-29 | SUBIÓ |
|2020-06-30 | SUBIÓ|
|2020-07-01| SUBIÓ|
|2020-07-02 | BAJÓ|

2. Fecha y valor del volumen más alto.
3. Fecha y valor del volumen más bajo.
4. Fecha y valor de la apertura más baja.
5. Fecha y valor del cierre más alto.
"""

import csv

def solucion():

  leer_csv = open('TSLA.csv', 'r')
  tesla = csv.reader(leer_csv)
  list_tesla = []
  for i in tesla:
    list_tesla.append(i)
  leer_csv.close()

  list_date, list_volumen, list_open, list_close = [], [], [], []

  for i in list_tesla[1:]:
    list_date.append(i[0])
    list_volumen.append(float(i[6]))
    list_open.append(float(i[1]))
    list_close.append(float(i[4]))

  # Cálculos
  # Max Volumen
  max_vol = max(list_volumen)
  indx = list_volumen.index(max_vol)
  date_max_vol = list_date[indx]

  # Min Volumen
  min_vol = min(list_volumen)
  indx1 = list_volumen.index(min_vol)
  date_min_vol = list_date[indx1]

  # Min Open
  min_open = min(list_open)
  indx2 = list_open.index(min_open)
  date_min_open = list_date[indx2]

  # Max Close
  max_close = max(list_close)
  indx3 = list_close.index(max_close)
  date_max_close = list_date[indx3]  

  # Exportar csv
  tesla_out = [['Fecha', 'Comportamiento']]
  for i in list_tesla[1:]:
    if float(i[1]) < float(i[4]):
      concepto = 'SUBIO'
    else:
      concepto = 'BAJO'
    tesla_out.append([i[0], concepto])

  out_csv = open('tendencia.csv', 'w')
  out = csv.writer(out_csv, delimiter='\t')

  for i in tesla_out:
    out.writerow(i)
  out_csv.close()
    
  return date_max_vol, max_vol, date_min_vol, min_vol, date_min_open, min_open, date_max_close, max_close

resultado = solucion()
